import React, { useState } from 'react';
import "./Navbar.css";

function Navbar(){

    const [currentState, setState] = useState('Home');

    function buttonHandler(newState) {
        setState(newState);
        console.log(newState);
        console.log(currentState);
    }

    return (
        <div className="div">
            <ul className="navbar">
                <li className="box"><button onClick={() => this.buttonHandler("home")}>Home</button></li>
                <li className="box"><button onClick={() => this.buttonHandler("bio")}>Bio</button></li>
                <li className="box"><button>Education</button></li>
                <li className="box"><button>Projects</button></li>
                <li className="box"><button>Professional</button></li>
            </ul>
        </div>
    )
}

export default Navbar;
